def firstUniqChar(s):
    """
    :type s: str
    :rtype: int
    """
    for i in range(0, len(s)):
        if s[i+1:].find(s[i]) == -1 and s[0:i].find(s[i]) == -1 :
            return i

    return -1


print(firstUniqChar("leetcode"))
print(firstUniqChar("loveleetcode"))
print(firstUniqChar("ccd"))
print(firstUniqChar(""))